const DeviceMaxLedLimit = 4056;
let ChannelArray = 
[
	["Channel 1", 4056],
];

function SetupChannels()
{
	device.SetLedLimit(DeviceMaxLedLimit);

	for(let i = 0; i < ChannelArray.length; i++)
	{
		device.addChannel(ChannelArray[i][0], ChannelArray[i][1]);
	}
}

const PluginVersion = "1.0.0";

const vKeyNames = [];
const vKeyPositions = [];
const MaxLedsInPacket = 169;

var lastHWLchange = 0;
var HWLupdateRequested = false;

export function LedNames()
{
	return vKeyNames;
}

export function LedPositions()
{
	return vKeyPositions;
}

export function Initialize()
{
	SetupChannels();
	requestFirmwareVersion();
}

function compareFirmwareVersion()
{
	let firmwarePacket = device.read([0x00], 4, 10);
	let FirmwareVersion = firmwarePacket[1] + "." + firmwarePacket[2] + "." + firmwarePacket[3]
	device.log("SRGBmods LC v2 Firmware version: " + FirmwareVersion);
	device.log("SRGBmods LC v2 Plugin version:   " + PluginVersion);
	if(FirmwareVersion !== PluginVersion)
	{
		device.log("Firmware <-> Plugin version mismatch! Make sure to use matching versions!");
		device.notify(`Firmware ${FirmwareVersion} <-> Plugin ${PluginVersion} version mismatch!`, `Make sure to use matching versions!`, 0);
	}
}

function requestFirmwareVersion()
{
	let packet = [ 0x00, 0x00, 0x00, 0x00, 0x00, 0xCC ];
	device.write(packet, 513);
	compareFirmwareVersion();
}

export function Render()
{
	for(let i = 0; i < ChannelArray.length; i++)
	{
		SendChannel(i);
	}
	if(HWLupdateRequested == true)
	{
		var currentTime = Date.now();
		if(currentTime - lastHWLchange >= 3000)
		{
			updateHWLsettings();
		}
	}
}

export function Shutdown()
{
	for(let i = 0; i < ChannelArray.length; i++)
	{
		SendChannel(i, true);
	}
}

function SendChannel(Channel, shutdown = false)
{
	let ChannelLedCount = device.channel(ChannelArray[Channel][0]).ledCount > ChannelArray[Channel][1] ? ChannelArray[Channel][1] : device.channel(ChannelArray[Channel][0]).ledCount;

	let RGBData = [];

	if(shutdown)
	{
		RGBData = device.createColorArray(shutdownColor, ChannelLedCount, "Inline");
	}
	else if(LightingMode === "Forced")
	{
		RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline");
	}
	else
	{
		const deviceCh = device.channel(ChannelArray[Channel][0]);
		RGBData = deviceCh.getColors("Inline");
		const components = deviceCh.getComponentNames();
		const componentCount = components.length;

		for(let currComp = 0; currComp < componentCount; currComp++)
		{
			var DeviceLedCount = deviceCh.getComponentData(components[currComp]).LedCount;
			const DeviceRGBData = RGBData.splice(0, ((DeviceLedCount)*3));
			
			var NumPackets = Math.ceil(DeviceLedCount / MaxLedsInPacket);

			for(var CurrPacket = 1; CurrPacket <= NumPackets; CurrPacket++)
			{
				var packet = [0x00, CurrPacket, 0x00, NumPackets, currComp + 1, 0xAA];
				packet = packet.concat(DeviceRGBData.splice(0, 507));
				device.write(packet, 513);
			}
		}
	}
}

function hexToRgb(hex)
{
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

export function onStatusLED_enableChanged(){ HWL_setting_updated(); }
export function onHWL_enableChanged(){ HWL_setting_updated(); }
export function onHWL_effectModeChanged(){ HWL_setting_updated(); }
export function onHWL_returnChanged(){ HWL_setting_updated(); }
export function onHWL_returnafterChanged(){ HWL_setting_updated(); }
export function onHWL_effectSpeedChanged(){ HWL_setting_updated(); }
export function onHWL_colorChanged(){ HWL_setting_updated(); }
export function onHWL_brightnessChanged(){ HWL_setting_updated(); }

function HWL_setting_updated()
{
	lastHWLchange = Date.now();
	HWLupdateRequested = true;
}

function updateHWLsettings()
{
	if(HWLupdateRequested == true)
	{
		HWLupdateRequested = false;
		var hwlenable = HWL_enable == true ? 0x01 : 0x00;
		var hwleffectMode;
		if(HWL_effectMode == "Rainbow Wave") { hwleffectMode = 1; }
		else if(HWL_effectMode == "Rainbow Cycle") { hwleffectMode = 2; }
		else if(HWL_effectMode == "Solid Color") { hwleffectMode = 3; }
		else if(HWL_effectMode == "Breathing Color") { hwleffectMode = 4; }
		var hwlreturn = HWL_return == true ? 0x01 : 0x00;
		var hwlcolor = hexToRgb(HWL_color);
		var statusledenable = StatusLED_enable == true ? 0x01 : 0x00;
			
		let packet = [0x00, 0x00, 0x00, 0x00, 0x00, 0xBB, hwlenable, hwlreturn, HWL_returnafter, hwleffectMode, HWL_effectSpeed, HWL_brightness, hwlcolor[0], hwlcolor[1], hwlcolor[2], statusledenable ];
		device.write(packet, 513);
	}
}

